import * as o from "react";
import e from "../lib/SSRBase.es.js";
import r from "../defs/Laptop.es.js";
const t = o.forwardRef((a, p) => /* @__PURE__ */ o.createElement(e, { ref: p, ...a, weights: r }));
t.displayName = "LaptopIcon";
const c = t;
export {
  c as Laptop,
  t as LaptopIcon
};
